export default {
  data() {
    return {
      editableTransport: null,
      currentRank: 0,
      rankList: []
    };
  },
  computed: {},
  methods: {
    changeRank(rank) {
      this.currentRank = rank;
    },
    onSave() {
      this.$callClient("Controls:VehiclesSetRank", this.currentRank, this.editableTransport.id);
    },
    goBack() {
      this.$router.push("/organization/transport/main");
    },
    setData(editableTransport, shortRanks) {
      this.editableTransport = editableTransport;
      this.currentRank = editableTransport.rankId;
      this.rankList = shortRanks;
    }
  },
  mounted() {
    this.$onClient("Constrols:TransportEditor:SetData", this.setData);
    this.$callClient("Controls:TransportEditor:Ready");
  }
};
